import { ItemRow } from "./itemRow"

function Main() {
  return (
    <div className="main-wrapper">
{
        Array.from({ length: 7 }, (v, i) => (
          <ItemRow key={i} />
        ))
      }
    </div>
  )
}

export {Main}
